import React from "react";
import styled from "styled-components";

const OptionButton = styled.button`
  // 여기에 스타일 추가
`;

export default function SelectCuisine({ onSelect }) {
  return (
    <>
      <OptionButton onClick={() => onSelect("korean")}>한식</OptionButton>
      <OptionButton onClick={() => onSelect("japanese")}>일식</OptionButton>
      <OptionButton onClick={() => onSelect("chinese")}>중식</OptionButton>
    </>
  );
}
